(lib.mcJackoLantern = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{idle:0,anim:13},true);

	// timeline functions:
	this.frame_12 = function() {
		this.gotoAndPlay("idle");
	}
	this.frame_25 = function() {
		if(this.onAnimEnd) { this.onAnimEnd(this); }
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).wait(12).call(this.frame_12).wait(13).call(this.frame_25));

	// jack on
	this.instance_1 = new lib.JackoLantern02("synched",0);
	this.instance_1.setTransform(-10.9,5.4);
	this.instance_1._off = true;

	this.timeline.addTween(cjs.Tween.get(this.instance_1).wait(13).to({startPosition:0,_off:false},0).to({_off:true},1).wait(1).to({x:-9.8,y:4.4,_off:false},0).to({_off:true},1).wait(1).to({startPosition:0,_off:false},0).wait(1).to({startPosition:0},0).to({_off:true},1).wait(1).to({startPosition:0,_off:false},0).wait(6));

	// jack off
	this.instance_2 = new lib.JackoLantern01("synched",0);

	this.timeline.addTween(cjs.Tween.get(this.instance_2).to({y:-4.8},3).to({y:0},3).to({y:5},3).to({y:0},3).to({_off:true},8).wait(6));

}).prototype = p = new cjs.MovieClip();
p.nominalBounds = new cjs.Rectangle(-110,-140.9,220.2,281.9);

